 (queryPaths: string[]) => {
  const projectNestedPathObject = queryPaths
    ? queryPathsArrayToNestedPathObject(queryPaths)
    : undefined;

  /**
   * This one too
   */
  const nestedMenu = projectNestedPathObject
    ? nestedPathObjectToNestedMenuRecursive(projectNestedPathObject, [], {
        getHref: (fullPath) => {
          return fullPath;
        },
      })
    : undefined;

  const result = nestedMenu?.map((item) => {
    const webPage: WebPage<undefined> = {
      queryPath: item.title,
      menuTitleTooltip: "Should be replaced with WebPage model",
      pageData: undefined,
    };

    return webPage;
  });

  return result;
}
